import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [form, setForm] = useState({
    nombre: '',
    edad: '',
    pais: '',
    ocupacion: '',
    anios: ''
  });

  const handleChange = (e) => {
    const { id, value } = e.target;
    setForm({ ...form, [id]: value });
  };

  const isValid = (value) => value.trim() !== '';

  return (
    <div className="App">
      <form className="row g-3 px-5 py-5 container mx-auto">
        <div className="col-md-4">
          <label htmlFor="nombre" className="form-label">Nombre completo:</label>
          <input
            type="text"
            id="nombre"
            value={form.nombre}
            onChange={handleChange}
            className={`form-control ${isValid(form.nombre) ? 'is-valid' : 'is-invalid'}`}
            required
          />
          <div className="valid-feedback">Looks good!</div>
          <div className="invalid-feedback">Campo requerido</div>
        </div>

        <div className="col-md-4">
          <label htmlFor="edad" className="form-label">Edad:</label>
          <input
            type="number"
            id="edad"
            value={form.edad}
            onChange={handleChange}
            className={`form-control ${isValid(form.edad) ? 'is-valid' : 'is-invalid'}`}
            required
          />
          <div className="valid-feedback">Looks good!</div>
          <div className="invalid-feedback">Campo requerido</div>
        </div>

        <div className="col-md-4">
          <label htmlFor="pais" className="form-label">País:</label>
          <input
            type="text"
            id="pais"
            value={form.pais}
            onChange={handleChange}
            className={`form-control ${isValid(form.pais) ? 'is-valid' : 'is-invalid'}`}
            required
          />
          <div className="valid-feedback">Looks good!</div>
          <div className="invalid-feedback">Campo requerido</div>
        </div>

        <div className="col-md-4">
          <label htmlFor="ocupacion" className="form-label">Ocupación:</label>
          <input
            type="text"
            id="ocupacion"
            value={form.ocupacion}
            onChange={handleChange}
            className={`form-control ${isValid(form.ocupacion) ? 'is-valid' : 'is-invalid'}`}
            required
          />
          <div className="valid-feedback">Looks good!</div>
          <div className="invalid-feedback">Campo requerido</div>
        </div>

        <div className="col-md-4">
          <label htmlFor="anios" className="form-label">Años de trabajo:</label>
          <input
            type="number"
            id="anios"
            value={form.anios}
            onChange={handleChange}
            className={`form-control ${isValid(form.anios) ? 'is-valid' : 'is-invalid'}`}
            required
          />
          <div className="valid-feedback">Looks good!</div>
          <div className="invalid-feedback">Campo requerido</div>
        </div>

        <div className="col-12">
          <button className="btn btn-primary" type="submit">Registrar</button>
        </div>
      </form>
    </div>
  );
}

export default App;
